import React from 'react';
import 'mdb-react-ui-kit/dist/css/mdb.min.css'

function Main(props) {
	return (
		<>
			<video autoplay controls loop muted poster="aaa" preload="bbb">
				<source src="https://youtu.be/psVZw5IVBjQ" type="video/mp4"/>
			</video>
		</>
	);
};

export default Main;
